import React from 'react';

function Footer() {
  return (
    <footer className="bg-black text-white p-4 text-center absolute bottom-0 w-full">
      Creado por el <a href="https://www.linkedin.com/in/marco-piermatei/" target="_blank" rel="noopener noreferrer" className="underline">pipi</a>. Todos los derechos requete re mil reservades.
    </footer>
  );
}

export default Footer;
